import { takeLatest } from "redux-saga/effects";
import { GET_LIST } from "../constants/ListTypes";
import { handleGetLists } from "./handlers/lists";

export function* watcherSaga() {
    
    try{
        console.log('yes');

        yield takeLatest(GET_LIST, handleGetLists);
    }catch(e){
        
    }
}
